import { Box, Center, Stack } from "@mantine/core";
import React from "react";

const ResponsivePhone = () => {
  return (
    <Stack>
      <Center>
        <Box style={{ border: "1px solid #1b1c1b", borderRadius: "15px 15px 5px 5px" }}>Mobile</Box>
      </Center>
    </Stack>
  );
};

export default ResponsivePhone;
